import React from "react";
import "./index";
import "./style.scss";

const Calender = () => {
    return (
        <html lang="en">
            <body>
                <div class="calendar-rectangle">
                    <div id="calendar-content" class="calendar-content"></div>
                </div>
            </body>
        </html>
    );
}
export default Calender;
